import Admin from "../../components/pagAdm.js";
import './index.scss';
export default function Index(){
    return(
        <main>
            <Admin logo='/images/logoAdmin.png'/>
            
            <div className="PedRecentes">
            
            <div>
                <h2 className="B">Bem vindo a área de administração</h2>
            </div>
            <div>
                <h2>Pedidos Recentes</h2>
            </div>
            </div>
        </main>
    )
}
